import { VFC } from 'react';
import styled from "styled-components";

type IconLinkProps = {
    href: string,
    src: string,
    alt: string,
    hoge: string,
}

export const IconLink:VFC<IconLinkProps> = ({href,src,alt})=> {
    return(
        <a href={href}><StyledIconLink src={src} alt={alt}></StyledIconLink></a>
    )
}

const StyledIconLink =styled.img`
    width:${(props)=>props.hoge};
    height:auto;
    margin-right:7px;
    padding: 8px 16px;
    background: black;
&:hover{
    background: #383d43;
	transition: 0.2s ;
}
`
